import Ho from './Home.module.css';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className={Ho.main}>
      <div className={Ho.navbar}>
        <nav>
          <h1>Todo List</h1>
          <Link>About</Link>
          <Link>About</Link>
          <Link>About</Link>
          <Link>About</Link>
        </nav>
      </div>
    </div>
    
  );
}

export default Home;
